Google 번역으로 번역 한 것이지만, 전해지는 것일까?

I can’t believe the amount of people who still (delusionally) believes Dina should’ve won just because of the _one single error_ Linoy did in the ribbon routine….so, let me explain why and how Dina lost *fair and square* to Linoy - nothing major, just some facts that always get (conveniently) forgotten…

1) A rhythmic gymnastics competition is not made by one routine, but by 4 routines;
2) The final score is made by the sum of those 4 routines’ scores; 
3) Linoy’s difficulty scores were consistently the highest in _all_ her 4 routines (ribbon included, as execution errors have no impact on the difficulty score); 
4) Dina’s difficulties on the other hand were lower and her execution not as consistent as Linoy’s (as proven by small imperfections in all Dina’s routines and *Linoy getting a higher execution score as well* in a couple of her routines); 
5) Linoy paid for that mistake in her ribbon (with a very low execution score for the routine); 
6) Dina got the highest score of all in the ribbon rotation (proof that judgement was fair and on point).

